import React from "react";
import { css } from "@emotion/css";
import styled from "@emotion/styled";
import { GrEdit } from "react-icons/gr";
import { AiFillDelete, AiOutlineCheck } from "react-icons/ai";
import "./card.css";
const MusicCard = styled.div`
  margin: 10px 10px;
  height: 300px;
  width: 200px;
  border-radius: 10px;
  border: 1px solid black;
  display: flex;
  align-items: center;
  justify-content: space-evenly;
  padding: 10px;
  flex-direction: column;
  -webkit-box-shadow: 10px -4px 18px 4px rgba(0, 0, 0, 0.75);
  -moz-box-shadow: 10px -4px 18px 4px rgba(0, 0, 0, 0.75);
  box-shadow: 10px -4px 18px 4px rgba(0, 0, 0, 0.75);
  font-family: "Lily Script One";

  &:hover {
    transform: scale(1.05);
  }
`;
const Circe = styled.div`
  height: 150px;
  width: 150px;
  border-radius: 50%;
  display: flex;
  border: 1px solid black;
  align-self: center;
  background-image: url("https://i.discogs.com/aG7IGbJKg03ax8ssKvbgaFN7c5kYMTOQ-KTr7Fs72GE/rs:fit/g:sm/q:90/h:341/w:352/czM6Ly9kaXNjb2dz/LWRhdGFiYXNlLWlt/YWdlcy9BLTQ1NDUy/My0xMjk3ODk1NTk5/LmpwZWc.jpeg");
  background-size: cover;
`;

function Card() {
  return (
    <div>
      <section className="pricing">
        <div className="row">
          <div className="col-1-of-3">
            <div className="card">
              <div className="card__side card__side--front card__side--front-1">
                <div className="card__pic card__pic--1"></div>

                <div className="card__details">
                  <ul>
                    <li>Awey sew mehone</li>
                    <li>Aster Aweka</li>
                    <li>Soul Jazz</li>
                    <li>Album</li>
                  </ul>
                </div>
              </div>
              <div className="card__side card__side--back card__side--back-1">
                <div
                  className={css`
                    display: flex;
                    align-self: flex-start;
                    justify-content: space-between;
                    padding: 10px;
                    cursor: pointer;
                  `}
                >
                  <AiFillDelete size={20} />
                  <GrEdit size={20} />
                </div>
                <div
                  className={css`
                    display: flex;
                    flex-direction: column;
                    justify-content: center;
                  `}
                >
                  <input placeholder="heloo" />
                  <input placeholder="heloo" />
                  <input placeholder="heloo" />
                  <input placeholder="heloo" />
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
}

export default Card;
